import React from "react";
import "./Login.css";
import path from "../assets/path.svg";
import deski_white from "../assets/deski_white.svg";
import { Pane, TextInput, Button } from "evergreen-ui";

function Login() {
    return (
        <div className="lo">
            <div className="login_path">
                <img src={path} alt="" className="path" />
                <div className="login_logo">
                    <img src={deski_white} alt="" height="80" width="120" />
                </div>
                <div className="login">
                    <Pane className="login_pane">
                        <p className="p1">Login to continue</p>
                        <h5>Your teams site</h5>
                        <TextInput width={265} className="login_inputfield" borderRadius={2} placeholder="Enter email" />
                        <TextInput width={265} className="login_inputfield" borderRadius={2} placeholder="Password" />
                        <Button width={265} className="login_inputfield" backgroundColor="blue" color="white">
                            Continue
                        </Button>
                        <p className="p2">OR</p>
                        <Button
                            width={265}
                            className="login_inputfield"
                            backgroundColor="white"
                            border="none"
                            elevation={5}
                        >
                            Continue
                        </Button>
                    </Pane>
                </div>
            </div>
        </div>
    );
}

export default Login;
